    <div>
      <FooterTitle title="HELLSTONE" />

      <p className="text-white">
        Here you can use rows and columns to organize your footer content. Lorem
        ipsum dolor sit amet, consectetur adipisicing elit.
      </p>
    </div>
  );
};
